import React from "react";
import "./Adminproductmain.css";

export default function Adminproductmain() {
  return (
    <>
      <div className="adminproductmain">
        <div className="adminproductmain_col1"></div>
        <div className="adminproductmain_col2">
            <div className="adminproductmain_col2_row1"></div>
            <div className="adminproductmain_col2_row2"></div>
        </div>
      </div>
    </>
  );
}
